package javasessions;

public class numberWithoutNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int one='A'/'A';
		String s="..........";
		int len=s.length();
		for(int i=one;i<=len*len;i++) {
			System.out.println(i);
		}
		System.out.println("******************");
		for(int i=one;i<='d';i=i+one) {
			System.out.println(i);
		}
	}

}
